import React from 'react'
import styled from 'styled-components'

const Content = styled.span``
interface PropsType {
	body: string
	id: number
}
export const CommentItem: React.FC<PropsType> = ({ body, id }): React.ReactElement => {
	return <Content>{id}. {body}</Content>
}
